a fecha. El formato de devolución de la fecha se puede personalizar mediante los ajustes del campo.','An interactive UI for picking a time. The time format can be customized using the field settings.'=>'Una interfaz de usuario interactiva para elegir una hora. El formato de la hora se puede personalizar mediante los ajustes del campo.','An interactive UI for selecting a color, or specifying a Hex value.'=>'Una interfaz de usuario interactiva para seleccionar un color o especificar un valor hexadecimal.','An interactive UI for selecting a location using Google Maps. Requires a Google Maps API key and additional configuration to display correctly.'=>'Una interfaz de usuario interactiva para seleccionar una ubicación utilizando Google Maps. Requiere una clave API de Google Maps y configuración adicional para mostrarse correctamente.','An interactive and customizable UI for picking one or many posts, pages or post type items with the option to search. '=>'Una interfaz de usuario interactiva y personalizable para seleccionar una o varias entradas, páginas o elementos de tipo contenido con la opción de buscar. ','An interactive component for embedding videos, images, tweets, audio and other content by making use of the native WordPress oEmbed functionality.'=>'Un componente interactivo para incrustar videos, imágenes, tweets, audio y otros contenidos haciendo uso de la funcionalidad oEmbed nativa de WordPress.','An interactive dropdown to select one or more posts, pages, custom post type items or archive URLs, with the option to search.'=>'Un desplegable interactivo para seleccionar una o más entradas, páginas, elementos de tipo contenido personalizad o URL de archivo, con la opción de buscar.','Displays the WordPress WYSIWYG editor as seen in Posts and Pages allowing for a rich text-editing experience that also allows for multimedia content.'=>'Muestra el editor WYSIWYG de WordPress tal y como se ve en las Entradas y Páginas, permitiendo una experiencia de edición de tex